import { NavLink } from 'react-router-dom'

function NavBar() {
    return (
      <div className="nav-bar">
        <NavLink
        to="/homepage"
        activeStyle={{
            fontWeight: "bold",
            color: "red",
            textDecoration: 'none'
        }}
        >
        Home
        </NavLink>

        <NavLink
        to="/photo"
        activeStyle={{
            fontWeight: "bold",
            color: "red",
            textDecoration: 'none'
        }}
        style={{
            fontWeight: "bold",
            color: "black",
            textDecoration: 'none'
        }}
        >
        Photo
        </NavLink>

      </div>
    );
  }

  export default NavBar;
